import { Box, Grommet } from 'grommet';

const LoginPage = () => (
  <Grommet>
    <Box
      direction="row"
      border={{ color: 'brand', size: 'large' }}
      pad="medium"
    >
      <Box pad="medium" background="dark-3" />
      <Box pad="small" background="light-3" />
    </Box>
  </Grommet>
)

export default LoginPage;
